script: |
  super -f text -I q5290.spq | sort > q5290.out

inputs:
  - name: q5290.spq
    data: |
      SELECT ALL col2 * - col1 + col0 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col1 IN ( + col2 * + col1, col1, col0 + + col2, + col2, col0 );
  - name: tab1

outputs:
  - name: q5290.out
    data: |
